import styles from './Header.module.css'
import MainNavbar from './MainNavigation/MainNavbar'

export default function Header(props) {
    return (
        <header className={`${styles.transparentNavbar} ${styles.whiteNavbar}`}>
            <MainNavbar/>
        </header>
    )
}
